    false,nt"url": null,nt"notes": "The U.S. Fish and Wildlife Service and
    the National Park Service are preparing a management plan for bison and elk inhabiting
    the National Elk Refuge and Grand Teton National Park. As part of the preparation
    of the Environmental Impact Statement (EIS), social and economic issues must be
    addressed. Therefore, the objective of this survey and analysis was to quantify
    visitor and household attitudes, recreation use values, and the regional economic
    impacts such as local income and employment effects of alternatives for managing
    the bison and elk inhabiting the Refuge and the Park.",nt"license_title": "License
